import {useNavigate} from "react-router-dom";
import './'
const Logout = ()=> {
    const navigate = useNavigate();
    const handleLogout = ()=> {
        localStorage.setItem("authorization", "");
        navigate("/");
    }
    return (
        <>
        <button className="logoutbtn" onClick={handleLogout}>Logout</button>
        </>
    )
}
export default Logout;
